import { SendVote } from "../App";


function VoteBox(props) {
    var Choices = props.Choices;

    return(
        <div>
            <h1>Vote</h1>
            <ul>
            {Choices.map((Choice) => {
                    return (<button onClick={SendVote(Choice.Id)}>{Choice.text}</button>).addEventListener('click', SendVote(Choice.Id));
                })}
            </ul>
        </div>
        
    );
}

export default VoteBox;
